@param outputPath 结果图像保存路径；null表示不保存结果图像

MatchTemplatesConfig.setMethod
设置模板匹配方法

@param method 匹配算法方法标识；null表示使用默认匹配方法

MatchTemplatesConfig.setParallel
设置是否启用并行处理

@param parallel true表示启用并行处理，false表示禁用；null表示使用默认设置
